INSERT INTO `SERVMASK_PREFIX_aioseo_cache` VALUES (4,'addons','a:6:{i:0;O:8:\"stdClass\":14:{s:3:\"sku\";s:16:\"aioseo-image-seo\";s:4:\"name\";s:9:\"Image SEO\";s:7:\"version\";s:5:\"1.0.7\";s:5:\"image\";N;s:4:\"icon\";s:13:\"svg-image-seo\";s:6:\"levels\";a:5:{i:0;s:8:\"business\";i:1;s:6:\"agency\";i:2;s:4:\"plus\";i:3;s:3:\"pro\";i:4;s:5:\"elite\";}s:13:\"currentLevels\";a:3:{i:0;s:4:\"plus\";i:1;s:3:\"pro\";i:2;s:5:\"elite\";}s:15:\"requiresUpgrade\";b:1;s:11:\"description\";s:148:\"<p>Globally control the Title attribute and Alt text for images in your content. These attributes are essential for both accessibility and SEO.</p>\n\";s:18:\"descriptionVersion\";i:0;s:11:\"downloadUrl\";s:0:\"\";s:10:\"productUrl\";s:71:\"https://aioseo.com/docs/using-the-image-seo-features-in-all-in-one-seo/\";s:12:\"learnMoreUrl\";s:71:\"https://aioseo.com/docs/using-the-image-seo-features-in-all-in-one-seo/\";s:9:\"manageUrl\";s:44:\"https://route#aioseo-search-appearance:media\";}i:1;O:8:\"stdClass\":14:{s:3:\"sku\";s:20:\"aioseo-video-sitemap\";s:4:\"name\";s:13:\"Video Sitemap\";s:7:\"version\";s:5:\"1.1.1\";s:5:\"image\";N;s:4:\"icon\";s:16:\"svg-sitemaps-pro\";s:6:\"levels\";a:5:{i:0;s:10:\"individual\";i:1;s:8:\"business\";i:2;s:6:\"agency\";i:3;s:3:\"pro\";i:4;s:5:\"elite\";}s:13:\"currentLevels\";a:3:{i:0;s:6:\"agency\";i:1;s:3:\"pro\";i:2;s:5:\"elite\";}s:15:\"requiresUpgrade\";b:1;s:11:\"description\";s:243:\"<p>The Video Sitemap works in much the same way as the XML Sitemap module, it generates an XML Sitemap specifically for video content on your site. Search engines use this information to display rich snippet information in search results.</p>\n\";s:18:\"descriptionVersion\";i:0;s:11:\"downloadUrl\";s:0:\"\";s:10:\"productUrl\";s:54:\"https://aioseo.com/docs/how-to-create-a-video-sitemap/\";s:12:\"learnMoreUrl\";s:54:\"https://aioseo.com/docs/how-to-create-a-video-sitemap/\";s:9:\"manageUrl\";s:43:\"https://route#aioseo-sitemaps:video-sitemap\";}i:2;O:8:\"stdClas