INSERT INTO `SERVMASK_PREFIX_posts` VALUES (117,1,'2022-01-08 03:26:44','2022-01-08 03:26:44','<!-- wp:paragraph -->\n<p>By Edward Dokubo</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>FoodRevy sounds strange I know, itâ€™s just a mashup of â€œFoodâ€ which we all love and â€œReviewâ€, what we all look out for before downloading that app or seeing that movie on Netflix. Itâ€™s a start-up formed by a group of bright young minds with a passion for giving solutions to everyday problems through technology.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>In simple terms, FoodRevy is designed to give reviews of restaurants, dinners or any other name you call where food and drinks are sold. Using your location, it shows you the address of these restaurants, what they have on their menu, prices as well as first-hand reviews from real people who have visited them, not reviews from just anyone who may have been paid to give rave reviews but those from customers like you and me.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Since itâ€™s our first post, Iâ€™ll make this a really interesting read by sharing details of Tolu\'s experience just last week.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>So Tolu is a colleague of mine, we work in sales and with the festive season at its peak last week, things were crazy at the office, customers all over making big purchases for the holidays. Leaving home before 7 am and returning late with aches all over was the order of the day so when we got our pay plus a huge (not that huge) Christmas bonus it was like we won the lottery â€“ a compensation for the early morning hassle and backaches.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tolu got back home on Friday the 24th tired of an empty kitchen, at that point, even if her kitchen was stacked from floor to ceiling with foodstuff she wouldnâ€™t have cooked cause of the stress from work. On the bright side, she had her Christmas bonus (in cash) right in her bag. So she decided to eat out with her flatmate. They couldnâ€™t go to Toluâ€™s favourite restaurant on the island as it was getting late so they got in a cab and off they were to a restaurant not so far from home.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>As they stepped in, Tolu and her flatmate noticed this offensive odour but they both laughed it off, saying probably someone farted. They decided to take one of the tables outside so they could get fresh air and also stay far away from the bad smell whether it was fart or not. They made their orders and the waitress asked for their money as soon as the food was served. Tolu felt it was an odd policy but paid without questioning because the cash was there, you know thereâ€™s this confidence that comes with having money.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>A few spoons into her meal Tolu picked up a small chunk of meat, she chewed and chewed but the meat was still too tough to swallow, she felt it was saki (shaki) that wasnâ€™t properly cooked. Tolu got fed up and decided to take it out using a serviette. To her disgust she found saw it was a dirty piece of cloth she had been chewing on. She stormed out of the restaurant so sick to her stomach for just the thought of chewing on something so filthy.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Now back to FoodRevy, letâ€™s say Tolu knew about us on that fateful day, she could have easily found a better restaurant to spend her hard-earned Christmas bonus in, also not so far from her place. With FoodRevy she could have known that the restaurant was bad news because there must have been bad reviews about them. FoodRevy is important on those many occasions you want to treat yourself to a night out and good food case you deserve it.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>FoodRevy has a website, mobile app and is available in some major states in Nigeria; Lagos, Abuja, Rivers and Oyo.</p>\n<!-- /wp:paragraph -->','WHAT IS FOODREVY?','FoodRevy sounds strange I know, itâ€™s just a mashup of â€œFoodâ€ which we all love and â€œReviewâ€, what we all look out for before downloading that app or seeing that movie on Netflix. Itâ€™s a start-up formed by a group of bright young minds with a passion for giving solutions to everyday problems through technology.','publish','open','open','','what-is-foodrevy','','','2022-01-08 17:34:24','2022-01-08 17:34:24','',0,'https://foodrevyng.gq/?p=117',0,'post','',1);
