 cash) right in her bag. So she decided to eat out with her flatmate. They couldnâ€™t go to Toluâ€™s favourite restaurant on the island as it was getting late so they got in a cab and off they were to a restaurant not so far from home.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>As they stepped in, Tolu and her flatmate noticed this offensive odour but they both laughed it off, saying probably someone farted. They decided to take one of the tables outside so they could get fresh air and also stay far away from the bad smell whether it was fart or not. They made their orders and the waitress asked for their money as soon as the food was served. Tolu felt it was an odd policy but paid without questioning because the cash was there, you know thereâ€™s this confidence that comes with having money.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>A few spoons into her meal Tolu picked up a small chunk of meat, she chewed and chewed but the meat was still too tough to swallow, she felt it was saki (shaki) that wasnâ€™t properly cooked. Tolu got fed up and decided to take it out using a serviette. To her disgust she found saw it was a dirty piece of cloth she had been chewing on. She stormed out of the restaurant so sick to her stomach for just the thought of chewing on something so filthy.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Now back to FoodRevy, letâ€™s say Tolu knew about us on that fateful day, she could have easily found a better restaurant to spend her hard-earned Christmas bonus in, also not so far from her place. With FoodRevy she could have known that the restaurant was bad news because there must have been bad reviews about them. FoodRevy is important on those many occasions you want to treat yourself to a night out and good food case you deserve it.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>FoodRevy has a website, mobile app and is available in some major states in Nigeria; Lagos, Abuja, Rivers and Oyo.</p>\n<!-- /wp:paragraph -->','WHAT IS FOODREVY?','FoodRevy sounds strange I know, itâ€™s just a mashup of â€œFoodâ€ which we all love and â€œReviewâ€, what we all look out for before downloading that app or seeing that movie on Netflix. Itâ€™s a start-up formed by a group of bright young minds with a passion for giving solutions to everyday problems through technology.','inherit','closed','closed','','117-revision-v1','','','2022-01-08 03:26:44','2022-01-08 03:26:44','',117,'https://foodrevyng.gq/?p=119',0,'revision','',0);
